import React from 'react';
import { Button, Fab, IconButton, ButtonGroup } from '@material-ui/core';
import { LoopRounded, PlayArrowRounded, SkipNextRounded, SkipPreviousRounded} from '@material-ui/icons';

function MainControls(props) {
    return (
        <>
        <div style={{marginBottom: "10px"}}>
            <ButtonGroup>
                <Button aria-label="back">
                    <SkipPreviousRounded />
                </Button>
                <Fab aria-label="play">
                    <PlayArrowRounded />
                </Fab>
                <Button aria-label="next">
                    <SkipNextRounded />
                </Button>
            </ButtonGroup>

        </div>
        <div>
            <Fab variant="extended" 
                color="outlined"
                onClick={() => props.randomize()}
            >
            <LoopRounded /> Reset
            </Fab>
        </div>
        </>
    );
}

export default MainControls;
